<#
.SYNOPSIS
	Prank users by playing a fart noise.

.DESCRIPTION
	Running this script will decode the base64 string to an mp3 file in the temporary directory. Once the mp3 is played, it will then be removed leaving no traces.

.NOTES
	If this script is run as system, any logged in user will still be able to hear it. This was run as an April fools prank from Datto RMM.

	Embedding files into PowerShell scripts: https://loginvsi.com/login-vsi-blog/565-embed-external-files-in-powershell-scripts
#>

# Play a single media file, supported on Windows 10
Add-Type -AssemblyName presentationCore
$mediaPlayer = New-Object system.windows.media.mediaplayer

# Embedding the file
$Base64 = ""

# Decoding the file
$Content = [System.Convert]::FromBase64String($Base64)

# Writing content to temp directory
Set-Content -Path $env:temp\fart.mp3 -Value $Content -Encoding Byte

# Playing mp3
$mediaPlayer.open("$env:temp\fart.mp3")
$mediaPlayer.Play()

Start-Sleep -Seconds 3
$mediaPlayer.Stop()

# Removing content written to temp directory
Remove-Item $env:temp\fart.mp3